import React from "react";
import "./MainHeader.css";
function MainHeader() {
  return (
    <div className="header-section">
      <img src="path-to-your-image" alt="Robin" className="profile-pic" />
      <h1>I'm Robin Williams.</h1>
      <h2>A Product Designer based in Italy.</h2>
      <p>
        I'm probably the most passionate designer you will ever get to work
        with. If you have a great project that needs some amazing skills, I'm
        your guy.
      </p>
    </div>
  );
}
export default MainHeader;
